import React from 'react';

import '../stylesheets/main.css';
import { flexBox } from './bootstrap/classnames';


function Main() {
  return (
    <section className={flexBox}>
      <ul id='container'>
        <li className='box-slow'>VISUAL IDENTITY DESIGN</li>
        <li></li>
        <li className='other-box'>MARKETING AND ADVERTISING DESIGN</li>
        <li className='box'>USER INTERFACE GRAPHIC DESIGN</li>
        <li className='other-box'>PUBLICATION DESIGN</li>
        <li className='box'>PACKAGING DESIGN</li> 
        <li className='last-box'>MOTION GRAPHIC DESIGN</li> 
      </ul>
    </section>
  )
}

export default Main;
